import React from 'react'

function Box({header, body}) {

  return (
    <div className='w-96 h-64 bg-cyan-400 shadow-lg rounded-2xl p-8 m-8'>
        <header className='text-3xl'>
          {header}
        </header>
        <div className='pt-16'>
          {body}
        </div>
    </div>
  )
}

export default Box
